<p><b>祁答院 雄貴</b>（けどういん ゆうき、本名同じ、<a href="." id="link_1"                            >12月5日</a> - ）は、<a href="." id="link_3"                      >日本</a>の<a href="." id="link_4"                      >俳優</a>。<a href="." id="link_5"                                                                                            >アクトレインクラブ</a>所属。
</p><p>愛称は<b>ケドちゃん、ケドウィン、ウィンウィン</b>など。特技は<a href="." id="link_6"                      >殺陣</a>（桜月流美剱道公式スポンサードアーティスト）、<a href="." id="link_7"                      >乗馬</a>、<a href="." id="link_8"                                >テニス</a>。趣味は<a href="." id="link_9"                                          >潮干狩り</a>、森ランニング、ジムトレーニング。
</p>
